function fitness (current, suggested, target) {
	/*
		if target is closer to suggested
	*/
	
	if (target === suggested) {
		return target;
	}
	
	
	var distanceToSuggestedFromCurrent = new Number(bh.geo.getDistance(current.latitude, current.longitude, suggested.latitude, suggested.longitude));	
	var distanceToTargetFromCurrent = new Number(bh.geo.getDistance(current.latitude, current.longitude, target.latitude, target.longitude));
	
	var bearingFromSuggestedToTarget = bh.geo.bearingTo(suggested, target);
	var bearingFromCurrentToTarget = bh.geo.bearingTo(current, target);
	
	var bearingScore =  bearingFromSuggestedToTarget - bearingFromCurrentToTarget;
	
	console.log('BEARING: current: ' + bearingFromCurrentToTarget + ' -- suggested: ' + bearingFromSuggestedToTarget);
	
	var distanceScore = distanceToTargetFromCurrent - distanceToSuggestedFromCurrent;
	
		console.log('DISTANE: current: ' + distanceToTargetFromCurrent + ' -- suggested: ' + distanceToSuggestedFromCurrent);

	
	
	var availScoreForSuggested = new Number(suggested.bikesAvailable / suggested.emptySlots);
	var availScoreForCurrent = new Number(current.bikesAvailable / current.emptySlots);

	var availScore =  availScoreForSuggested - availScoreForCurrent;

	return bearingScore + distanceScore + availScore;
}




bh.routing = {
	
	HARD: 3,
	MEDIUM: 2, 
	EASY: 1,
	
	data: [],
	currentTarget: null,
	updateBikeStatsFeedCallback: null,
	
	makeCurrentTarget: function (dock) {
		this.currentTarget = dock;
	},
	
	periodicBikeTargetCheck: function() {
		if (!this.currentTarget || this.data) {
			return;
		}
		
		for (var i = 0; i < this.data.length; i++) {
			if (this.data[i].ID === this.currentTarget.ID) {
				if (this.data[i].emptySlots == 0) {
					return { status: 10, message: 'No free place to park your bike' };
				} else if (this.data[i].emptySlots < 2) {
					return { status: 20, message: 'Limited free places to park your bike' };
				}
			}
		}
		
	},
	
	updateBikeStatsFeed: function(callback) {
	
		/* check to see if network is reachable */
		
        Ext.util.JSONP.request({
                url: "http://query.yahooapis.com/v1/public/yql?q=select%20*%20from%20xml%20where%20url%3D'http%3A%2F%2Fapi.bike-stats.co.uk%2Fservice%2Frest%2Fbikestats'&format=json&diagnostics=true&callback=bh.routing.parseBikeStatsFeed",
                params: {},
              });
        if (callback) {
			this.updateBikeStatsFeedCallback = callback;
		}
	},
	
	parseBikeStatsFeed: function (request) {
		bh.routing.data = request.query.results.dockStationList.dockStation;
		if (this.updateBikeStatsFeedCallback) {
			this.updateBikeStatsFeedCallback(request);
		}
	},
	
	/*
	 * @param difficulty 1-3  --  1 is easiest, 3 is hardest route.
	 * @returns {"ID":"32", 
	 *					"latitude":"51.52469624",
	 *					"longitude":"-0.084439283", 
	 *					"name":"Leonard Circus , Shoreditch",
	 *					"temporary":"false",
	 *					"emptySlots":"17",
	 *					"bikesAvailable":"4"}
	 */
	getClosestBike: function(difficulty) {
	
		if (this.data == null) {
			return [];
		}
	
		var bikeArray = new Array;
		for (var i = 0; i < this.data.length; i++) {
			var bikeNode = this.data[i];
			bikeNode.distance = new Number(bh.geo.getDistance(bh.position[0], bh.position[1], bikeNode.latitude, bikeNode.longitude));
			var availScore = new Number(bikeNode.bikesAvailable / bikeNode.emptySlots);
			bikeNode.score = bikeNode.distance+ availScore.toFixed(1);
			bikeNode.h = 0;
			bikeNode.g = 0;
			bikeNode.f = 0;
			bikeArray.push(bikeNode);
		}
		
		bikeArray.sort(function(a,b) {
										if (a.score > b.score) {
											return 1;
										} else if (b.score > a.score) {
											return -1;
										} else {
											return 0;
										}
							}
		);
		
		if (difficulty == this.MEDIUM) {
			return bikeArray[Math.round(bikeArray.length / 2) ];
		} else if (difficulty == this.HARD) {
			return bikeArray[bikeArray.length-1];
		} else {
			//easy
			return bikeArray[0];
		}
	}
};

